import React from "react";
import Cardbar from "../../Components/CardBar/cardbar";
import jenny from "../../../src/Assets/Images/jenny.webp";

export default function applied() {
  return (
    <div className="flex flex-col justify-center items-center ">
      <Cardbar />
      <div className="bg-SecondaryWhite  md:w-[45rem] flex flex-col justify-center items-center gap-2  p-[16px] rounded-2xl capitalize ">
        <img src={jenny} alt="" />
      </div>
    </div>
  );
}
